import React from 'react';
import '../css/Login'

class Login extends React.Component {
  render() {
    return (
      <div>
        Login
        <div className="userContainer">
          <input type="email" placeholder="Email" />
          <input type="password" placeholder="Senha" />
        </div>
      </div>
    );
  }
}

export default Login;
